import React from "react";
import NavigationItem from "../NavigationItem/NavigationItem";
import styles from './NavigationItems.module.css';

const NavigationItems = (props) => {

    console.log(props.switchNav);
    return (
        <nav className={styles.NavigationItems}>
            <ul className={styles.ItemsLink}>
                <NavigationItem active link="/">Home</NavigationItem>

                <NavigationItem switchNavs={props.switchNav} expandNav={props.expandNav} returnNav={props.returnNav} child="repairs">Repairs</NavigationItem>

                <NavigationItem expandNav={props.expandNav} returnNav={props.returnNav}child="sale">Sale</NavigationItem>

                <NavigationItem>About Us</NavigationItem>

                <NavigationItem>Contact</NavigationItem>
            </ul>
        </nav>
    )
}

export default NavigationItems;
